-- Habilitar extensiones necesarias
CREATE EXTENSION IF NOT EXISTS postgis;
CREATE EXTENSION IF NOT EXISTS pgrouting;
SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "public"."natural" (gid serial,
"osm_id" float8,
"name" varchar(48),
"type" varchar(16));
ALTER TABLE "public"."natural" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('public','natural','geom','4326','MULTIPOLYGON',2);
CREATE INDEX ON "public"."natural" USING GIST ("geom");
COMMIT;
ANALYZE "public"."natural";
